                  <TableCell align="right">{contact.name}</TableCell>
                  <TableCell align="right">{contact.popularity}</TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      </div>
    );
  }
}

export default Contacts;
